import React, { useState, useEffect } from 'react'
import axios from 'axios'

import uris from '../../../uris'
import css from './Logs.module.scss'

const Logs = () => {
  const [data, setData] = useState([])
  const [query, setQuery] = useState('redux')

  const fetchData = async () => {
    const result = await axios(uris.baseUrl + uris.logs)
    setData(result.data)
  }

  useEffect(() => {
    if (data.length === 0) {
      fetchData()
    }
  }, [data])

  return (
    <React.Fragment>
      <button className={css.BtnRefresh} onClick={setQuery}>
        refresh
      </button>
      <ul className={css.UlLogs}>
        {data.map((l, key) => (
          <li key={key}>
            <span>Date:</span>
            {l.time}
            <span>Method:</span>
            {l.method}
            <span>Path:</span>
            {l.path}
          </li>
        ))}
      </ul>
    </React.Fragment>
  )
}

export default Logs
